import './Create.css';
import Header from '../Header/Header.js';
import Footer from '../Footer/Footer.js'
import toast, { Toaster } from 'react-hot-toast';
function BuildInitPage() {

    const notify = () => toast('Submission input passed', {
        duration: 4000,
        position: 'bottom-left',

        // Styling
        style: {},
        className: '',

        // Custom Icon
        icon: '‚úî',

        // Change colors of success/error/loading icon
        iconTheme: {
          primary: '#000',
          secondary: '#fff',
        }, 

        // Aria
        ariaProps: {
          role: 'status',
          'aria-live': 'polite',
        },
    });

    const checkInputs = async() => {
        const inputIds = {
          collectionSymbol: "",
          collectionSupply: "",
          collectionMintprice: "",
          collectionRedemptionRate: "",
          collectionInitialFunding: "",
          contactDiscord: "",
          contactX: ""
        };

        for (const id in inputIds) {
            const element = document.getElementById(id);
            const elementType = element.type;
            if (elementType === 'text') {
                if (element.value.length === 0) {
                    throw new Error(`No value provided at ${id}!`)
                }
                if (id === 'contactX' && !element.value.includes('@')) {
                    throw new Error(`Value ${id} does not contain '@'!`)
                }
                inputIds[id] = element.value;
            }
            if (elementType === 'number') {

                if (id === 'collectionRedemptionRate') {
                    if (!element.value) {
                        throw new Error(`No value provided at ${id}!`)
                    }
                    if (element.value > 100 || element.value < 0) {
                        throw new Error('Invalide redemption percentage')
                    }
                }

                if (elementType > 0) {
                    throw new Error(`No or to small value provided at ${id}!`)
                } else {
                    inputIds[id] = element.value;
                }
            }
        }
        console.log(inputIds);
        return inputIds;
    }

    const promiseToast = () => {
        toast.promise(
            checkInputs(),
            {
              loading: 'Loading',
              success: (data) => `Successfully submitted!`,
              error: (err) => `Error occured: ${err.toString()}`,
            },
            {
              style: {
                minWidth: '250px',
              },
              success: {
                duration: 4000,
                position: 'bottom-left',
                icon: 'üëç',
              },
              error: {
                position: 'bottom-left',
              }
            }
          );
    }

    return (
        <div className='creation-box'>
            <span className='textBox'>
                FILL OUT THE FORM TO CREATE A REDEMPTION POOL
            </span>
            <form id="creationForm">
                <div className='collectionData'>
                    <p>Collection</p>
                    <span>
                        <label>
                            Collection symbol:
                        </label>
                        <input id='collectionSymbol' type='text' placeholder='Cycle'></input>
                    </span>
                    <span>
                        <label>
                            Supply:
                        </label>
                        <input id="collectionSupply" type='number' placeholder='5555'></input>
                    </span>
                    <span>
                        <label>
                            Mintprice (SOL):
                        </label>
                        <input id="collectionMintprice" type='number' placeholder='1 SOL'></input>
                    </span>
                    <span>
                        <label>
                            Redemption rate (%):
                        </label>
                        <input id="collectionRedemptionRate" type='number' min={1} max={100} placeholder='1 - 100'></input>
                    </span>
                    <span>
                        <label>
                            Inital funding (SOL):
                        </label>
                        <input id="collectionInitialFunding" type='number' min={1} max={100000} placeholder='2500 SOL'></input>
                    </span>
                </div>
                <div className='contactData'>
                    <p>Contact</p>
                    <span>
                        <label>
                            Discord Username:
                        </label>
                        <input id="contactDiscord" type='text' placeholder='Username'></input>
                    </span>
                    <span>
                        <label>
                            X Username:
                        </label>
                        <input id="contactX" type='text' placeholder='@Username'></input>
                    </span>
                </div>
            </form>
            <div className='disclaimer'>
                <p>
                    <i>-Disclaimer-</i> <br></br>
                    Submitting the form does not create a pool automatically! <br></br>
                    Our team is devoted to delivering the highest security standards possible and will manually review each submission.
                </p>
            </div>
            <div className='btnBox'>
                <button className='submitBtn' onClick={() => promiseToast()}>
                    Submit
                </button>
            </div>
        </div>
    )
}

function Create() {
  return (
    <div id="create">
        <Header />
        <BuildInitPage />
        <Toaster />
        <Footer />
    </div>
  );
}

export default Create;
